import React from "react";
import "./BagPopUp.css";
const BagPopUp = () => {
  return (
    <div className="BagPopUp">
      <img src="/imges/emptyBagMesseg.svg" alt="emptyBag" />
    </div>
  );
};

export default BagPopUp;
